import Link from 'next/link'
const Navbar= ()=> (
   <div> 
     <ul>
           <li>
               <Link href="/">Home</Link>

           </li>
           <li>
               <Link href="/about">About</Link>

           </li>
       </ul>
       <style jsx>

           {`
           ul{
               background:#333;
               color:white ! important;
               list-style:none;
               display:flex;
           }
           ul li{
               font-size:30px;
               margin-right:20px;
           }
           ul li a{
               color:#fff;
               text-decoration:none;
           }
           `}
       </style>



           </div>
)

export default Navbar
